import React from 'react';

const MatchMenu = ({ matchdays, onSelectMatchday }) => {
  return (
    <div className="mb-4">
      <h2 className="text-xl font-bold mb-2">Match Days</h2>
      <ul className="flex space-x-4">
        {matchdays.map((matchday, index) => (
          <li key={index} className="cursor-pointer" onClick={() => onSelectMatchday(index + 1)}>
            Match Day {index + 1}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default MatchMenu;
